create table sys_user_online
(
    session_id       varchar(50)              default ''  not null comment '用户会话id',
    user_id          varchar(32)                          null comment '登录ID',
    username         varchar(50)              default ''  null comment '登录账号',
    dept_id          varchar(32)                          null comment '部门ID',
    dept_name        varchar(50)              default ''  null comment '部门名称',
    ip_address       varchar(50)              default ''  null comment 'IP',
    ip_location      varchar(255)             default ''  null comment 'IP地址',
    user_agent       varchar(2000)                        null comment '用户代理',
    browser          varchar(50)              default ''  null comment '浏览器类型',
    os               varchar(50)              default ''  null comment '操作系统',
    status           varchar(10)              default ''  null comment '在线状态on_line在线off_line离线',
    start_timestamp  datetime                             null comment 'session创建时间',
    last_access_time datetime                             null comment 'session最后访问时间',
    expire_time      int                      default 0   null comment '超时时间，单位为分钟',
    del_flag         char collate utf8mb4_bin default '0' null comment '0-正常，1-删除',
    constraint session_id
        unique (session_id)
)
    comment '在线用户记录';

alter table sys_user_online
    add primary key (session_id);

